import React, { useState, useEffect } from 'react';

function PlayerInfo() {
  const [players, setPlayers] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3001/Players")
    .then(resp=> resp.json())
    .then(data => setPlayers(data))
    
  },[]) 
}
export default PlayerInfo;
